// import logo from './logo.svg';
import './App.css';
import React from 'react';
import SearchForm from './SearchForm';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="container-fluid mt-5">
          <SearchForm />
        </div>
      </header>
    </div>
  );
}

export default App;
